'use strict';
let MessageType = require('./MessageType.js');
class CreateOrderMessage {
    offerId;
    orderId;
    error;
    requestTxt;
    constructor() {
        this.orderId = null;
        this.error = null;
        this.requestTxt = null;
    }
    getOrderId() {
        return this.orderId;
    }
    getError() {
        return this.error;
    }
    getRequestTxt() {
        return this.requestTxt;
    }
    getOfferId() {
        return this.offerId;
    }
    getType() {
        return MessageType.CreateOrder;
    }
}
module.exports = CreateOrderMessage
